import React from 'react';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import { Col, Row } from 'reactstrap';
import { Link } from 'react-router-dom';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

export default function CTA() {
    const classes = useStyles();

  return (
    <React.Fragment>
    <section className="section pt-0">
    <div className="productstitle">
    <h2 className="title">Where would you like to start?</h2>
    </div>

    <Container >
           <Row>

                       <Col lg="3" md="6" sm="12" className="developerctabox">
                           <div className="position-relative overflow-hidden shadow3d">

                               <h4 className="mt-3 text-center title text-dark">Fraktal Network</h4>
                               <p className="">Earn FRAK by contributing to development. </p>


                           </div>
                       </Col>

                       <Col lg="3" md="6" sm="12" className="developerctabox">
                           <div className="position-relative overflow-hidden shadow3d">

                               <h4 className="mt-3 text-center title text-dark">Applications</h4>
                               <p className="">Learn how to build a Fraktal powered application.</p>


                           </div>
                       </Col>

                       <Col lg="3" md="6" sm="12" className="developerctabox">
                           <div className="position-relative overflow-hidden shadow3d">

                               <h4 className="mt-3 text-center title text-dark">Staking</h4>
                               <p className="">Set up a Full Node and become a Validator. </p>


                           </div>
                       </Col>

                       <Col lg="3" md="6" sm="12" className="developerctabox">
                           <div className="position-relative overflow-hidden shadow3d">

                               <h4 className="mt-3 text-center title text-dark">Tutorials</h4>
                               <p className="">Learn something new.</p>


                           </div>
                       </Col>



           </Row>
       </Container>



    </section>

    </React.Fragment>
  );
}
